 insert into EPL_WARN_LABELS values ('9995','COTS','','0014','Consulte a un profesional de la salud antes de tomarmedicamentos sin receta mdica ya que algunos pueden afectar la accin de este medicamento.','Obtain medical advice before taking non-prescriptiondrugs as some may affect the action of this medication.','APPROVED','ACTIVE','','','1','','DEVELOPER','09-SEP-10 01.00.00.000000 AM','','');
 insert into EPL_WARN_LABELS values ('9996','COTS','','0094','Los productos o suplementos herbarios/dietticos puedeninteraccionar con este medicamento. Antes de tomartales productos, consltelo a su mdico o farmacutico.','Herbal/dietary supplement products may interact withthis medication. Discuss any such product with your doctor or pharmacist before taking.','APPROVED','ACTIVE','','','1','','DEVELOPER','09-SEP-10 01.00.00.000000 AM','','');
 insert into EPL_WARN_LABELS values ('9997','COTS','','0230','La Gua de Medicamentos que viene con este medicamento.','Read the Medication Guide that comes with this medicine','APPROVED','ACTIVE','','','1','','DEVELOPER','09-SEP-10 01.00.00.000000 AM','','');
 insert into EPL_WARN_LABELS values ('9998','COTS','','0009','Algunos medicamentos sin receta mdica pueden agravarsu afeccin. Lea todas las etiquetas con cuidado. Consulte a su mdico si se incluye alguna advertencia.','Some non-prescription drugs may aggravate yourcondition. Read all labels carefully. If a warningappears, check with your doctor.','APPROVED','ACTIVE','','','1','','DEVELOPER','09-SEP-10 01.00.00.000000 AM','','');
 insert into EPL_WARN_LABELS values ('9999','COTS','','0192','Dosis de este medicamento puede necesitar ajuste si queda embarazada. Justo despus de que se confirme su embarazo, contacte su mdico de salud primaria/su enfermera habilitada para nueva dosificacin de este medicamento.','The dose of this medication will likely need adjustment if you become pregnant. Soon after your pregnancy isconfirmed, contact your primary care doctor or nursepractitioner for the new dosage of medication.','APPROVED','ACTIVE','','','1','','DEVELOPER','09-SEP-10 01.00.00.000000 AM','','');
 insert into EPL_WARN_LABELS values ('99910','COTS','','0207','No tome anticidos 4 horas antes o despus de tomareste medicamento.','Do not take antacids within 4 hours of taking this medication.','APPROVED','ACTIVE','','','1','','DEVELOPER','09-SEP-10 01.00.00.000000 AM','','');
 insert into EPL_WARN_LABELS values ('99911','NATIONAL','','DROWSINESS','','MAY CAUSE DROWSINESS-Alcohol MAY intensify this effect. USE CARE when driving or when operating dangerous machinery.','APPROVED','ACTIVE','','','1','','DEVELOPER','09-SEP-10 01.00.00.000000 AM','','');
 insert into EPL_WARN_LABELS values ('99912','NATIONAL','','FINISH','','IMPORTANT: Finish all this medication unless otherwise directed by prescriber','APPROVED','ACTIVE','','','1','','DEVELOPER','09-SEP-10 01.00.00.000000 AM','','');
 insert into EPL_WARN_LABELS values ('99913','NATIONAL','','EMPTY STOMACH','','Take medication on an EMPTY STOMACH 1 hour before or 2-3 hours after a meal unless otherwise directed by your doctor.','APPROVED','ACTIVE','','','1','','DEVELOPER','09-SEP-10 01.00.00.000000 AM','','');
 insert into EPL_WARN_LABELS values ('99914','NATIONAL','','NO DAIRY PRODUCTS','','Do not take antacids or iron preparations or eat dairy products within 1 hour of taking this medication.','APPROVED','ACTIVE','','','1','','DEVELOPER','09-SEP-10 01.00.00.000000 AM','','');
